import "./Aside.scss" 
import Dialogs from "./Dialogs/Dialogs";
import Message from "./Message/Message";
import {Route} from ""

const Aside=(props)=>{
    return(
        <div className="Aside">
        <Route></Route>
        <Dialogs></Dialogs>
        <Message></Message>
        </div>
    );
}

export default Aside
